import React from 'react';
import { Routes, Route, useNavigate } from 'react-router-dom';
import AddVideo from '../../src/components/video/AddVieo'; // Corrected typo in file name
import AddCategory from '../../src/components/video/AddCategorey'; // Corrected typo in file name
import ShowVideos from '../../src/components/video/ShowVideos';
import Login from '../../src/components/auth/Login';
import Dashboard from '../dashboard';
import '../css/navbar.css';
import AppNavigation from './AppNavigation'; // Import the navigation component

const Navigation = () => {
  const navigate = useNavigate();

  const handleLogout = () => {
    navigate('/login');
  };

  const DefaultRoute = () => {
    return (
      <div>
        <h2>404 - Not Found</h2>
        <p>The page you are looking for does not exist.</p>
      </div>
    );
  };

  return (
    <div>
      {/* <AppNavigation /> Render the navigation component */}
      <Routes>
        <Route path="/" element={<Login />} />
        <Route path="/dashboard/add-video" element={<AddVideo />} />
        <Route path="/dashboard/add-category" element={<AddCategory />} />
        <Route path="/dashboard/show-videos" element={<ShowVideos />} />
        <Route path="/login" element={<Login />} /> 
        <Route path="/Dashboard" element={<Dashboard/>} /> 
        <Route path="*" element={<DefaultRoute />} /> {/* Default Route */}
      </Routes>
    </div>
  );
};

export default Navigation;
